'use strict';
let CommandEnvironment = require('./CommandEnvironment.js');
//@@DocBrief("The builder class of parameters to generate commands")
class CommandEnvironmentBuilder extends CommandEnvironment {
    setMessageRouter(messageRouter) {
        this.messageRouter = messageRouter;
    }
    setMessageExecutor(messageExecutor) {
        this.messageExecutor = messageExecutor;
    }
    setRequestNumberGenerator(requestNumberGenerator) {
        this.requestNumberGenerator = requestNumberGenerator;
    }
    setMessageFactory(messageFactory) {
        this.messageFactory = messageFactory;
    }
    setTradingTerminal(tradingTerminal) {
        this.tradingTerminal = tradingTerminal;
    }
    setConnectionParameters(connectionParameters) {
        this.connectionParameters = connectionParameters;
    }
    setConfigFlags(configFlags) {
        this.configFlags = configFlags;
    }
    build() {
        return this;
    }
}
module.exports = CommandEnvironmentBuilder
